{
  "components": {
    "schemas": {
      "io.k8s.api.core.v1.AWSElasticBlockStoreVolumeSource": {
        "description": "Represents a Persistent Disk resource in AWS.\n\nAn AWS EBS disk must exist before mounting to a container. The disk must also be in the same AWS zone as the kubelet. An AWS EBS disk can only be mounted as read/write once. AWS EBS volumes support ownership management and SELinux relabeling.",
        "properties": {
          "fsType": {
            "description": "fsType is the filesystem type of the volume that you want to mount. Tip: Ensure that the filesystem type is supported by the host operating system. Examples: \"ext4\", \"xfs\", \"ntfs\". Implicitly inferred to be \"ext4\" if unspecified. More info: https://kubernetes.io/docs/concepts/storage/volumes#awselasticblockstore",
            "type": "string"
          },
          "partition": {
            "description": "partition is the partition in the volume that you want to mount. If omitted, the default is to mount by volume name. Examples: For volume /dev/sda1, you specify the partition as \"1\". Similarly, the volume partition for /dev/sda is \"0\" (or you can leave the property empty).",
            "format": "int32",
            "type": "integer"
          },
          "readOnly": {
            "description": "readOnly value true will force the readOnly setting in VolumeMounts. More info: https://kubernetes.io/docs/concepts/storage/volumes#awselasticblockstore",
            "type": "boolean"
          },
          "volumeID": {
            "default": "",
            "description": "volumeID is unique ID of the persistent disk resource in AWS (Amazon EBS volume). More info: https://kubernetes.io/docs/concepts/storage/volumes#awselasticblockstore",
            "type": "string"
          }
        },
        "required": [
          "volumeID"
        ],
        "type": "object"
      },
      "io.k8s.api.core.v1.AzureDiskVolumeSource": {
        "description": "AzureDisk represents an Azure Data Disk mount on the host and bind mount to the pod.",
        "properties": {
          "cachingMode": {
            "description": "cachingMode is the Host Caching mode: None, Read Only, Read Write.",
            "type": "string"
          },
          "diskName": {
            "default": "",
            "description": "diskName is the Name of the data disk in the blob storage",
            "type": "string"
          },
          "diskURI": {
            "default": "",
            "description": "diskURI is the URI of data disk in the blob storage",
            "type": "string"
          },
          "fsType": {
            "description": "fsType is Filesystem type to mount. Must be a filesystem type supported by the host operating system. Ex. \"ext4\", \"xfs\", \"ntfs\". Implicitly inferred to be \"ext4\" if unspecified.",
            "type": "string"
          },
          "kind": {
            "description": "kind expected values are Shared: multiple blob disks per storage account  Dedicated: single blob disk per storage account  Managed: azure managed data disk (only in managed availability set). defaults to shared",
            "type": "string"
          },
          "readOnly": {
            "description": "readOnly Defaults to false (read/write). ReadOnly here will force the ReadOnly setting in VolumeMounts.",
            "type": "boolean"
          }
        },
        "required": [
          "diskName",
          "diskURI"
        ],
        "type": "object"
      },
      "io.k8s.api.core.v1.AzureFilePersistentVolumeSource": {
        "description": "AzureFile represents an Azure File Service mount on the host and bind mount to the pod.",
        "properties": {
          "readOnly": {
            "description": "readOnly defaults to false (read/write). ReadOnly here will force the ReadOnly setting in VolumeMounts.",
            "type": "boolean"
          },
          "secretName": {
            "default": "",
            "description": "secretName is the name of secret that contains Azure Storage Account Name and Key",
            "type": "string"
          },
          "secretNamespace": {
            "description": "secretNamespace is the namespace of the secret that contains Azure Storage Account Name and Key default is the same as the Pod",
            "type": "string"
          },
          "shareName": {
            "default": "",
            "description": "shareName is the azure Share Name",
            "type": "string"
          }
        },
        "required": [
          "secretName",
          "shareName"
        ],
        "type": "object"
      },
      "io.k8s.api.core.v1.CSIPersistentVolumeSource": {
        "description": "Represents storage that is managed by an external CSI volume driver (Beta feature)",
        "properties": {
          "controllerExpandSecretRef": {
            "allOf": [
              {
                "$ref": "#/components/schemas/io.k8s.api.core.v1.SecretReference"
              }
            ],
            "description": "controllerExpandSecretRef is a reference to the secret object containing sensitive information to pass to the CSI driver to complete the CSI ControllerExpandVolume call. This is an beta field and requires enabling ExpandCSIVolumes feature gate. This field is optional, and may be empty if no secret is required. If the secret object contains more than one secret, all secrets are passed."
          },
          "controllerPublishSecretRef": {
            "allOf": [
              {
                "$ref": "#/components/schemas/io.k8s.api.core.v1.SecretReference"
              }
            ],
            "description": "controllerPublishSecretRef is a reference to the secret object containing sensitive information to pass to the CSI driver to complete the CSI ControllerPublishVolume and ControllerUnpublishVolume calls. This field is optional, and may be empty if no secret is required. If the secret object contains more than one secret, all secrets are passed."
          },
          "driver": {
            "default": "",
            "description": "driver is the name of the driver to use for this volume. Required.",
            "type": "string"
          },
          "fsType": {
            "description": "fsType to mount. Must be a filesystem type supported by the host operating system. Ex. \"ext4\", \"xfs\", \"ntfs\".",
            "type": "string"
          },
          "nodeExpandSecretRef": {
            "allOf": [
              {
                "$ref": "#/components/schemas/io.k8s.api.core.v1.SecretReference"
              }
            ],
            "description": "nodeExpandSecretRef is a reference to the secret object containing sensitive information to pass to the CSI driver to complete the CSI NodeExpandVolume call. This is an alpha field and requires enabling CSINodeExpandSecret feature gate. This field is optional, may be omitted if no secret is required. If the secret object contains more than one secret, all secrets are passed."
          },
          "nodePublishSecretRef": {
            "allOf": [
              {
                "$ref": "#/components/schemas/io.k8s.api.core.v1.SecretReference"
              }
            ],
            "description": "nodePublishSecretRef is a reference to the secret object containing sensitive information to pass to the CSI driver to complete the CSI NodePublishVolume and NodeUnpublishVolume calls. This field is optional, and may be empty if no secret is required. If the secret object contains more than one secret, all secrets are passed."
          },
          "nodeStageSecretRef": {
            "allOf": [
              {
                "$ref": "#/components/schemas/io.k8s.api.core.v1.SecretReference"
              }
            ],
            "description": "nodeStageSecretRef is a reference to the secret object containing sensitive information to pass to the CSI driver to complete the CSI NodeStageVolume and NodeStageVolume and NodeUnstageVolume calls. This field is optional, and may be empty if no secret is required. If the secret object contains more than one secret, all secrets are passed."
          },
          "readOnly": {
            "description": "readOnly value to pass to ControllerPublishVolumeRequest. Defaults to false (read/write).",
            "type": "boolean"
          },
          "volumeAttributes": {
            "additionalProperties": {
              "default": "",
              "type": "string"
            },
            "description": "volumeAttributes of the volume to publish.",
            "type": "object"
          },
          "volumeHandle": {
            "default": "",
            "description": "volumeHandle is the unique volume name returned by the CSI volume pluginâ€™s CreateVolume to refer to the volume on all subsequent calls. Required.",
            "type": "string"
          }
        },
        "required": [
          "driver",
          "volumeHandle"
        ],
        "type": "object"
      },
      "io.k8s.api.core.v1.CephFSPersistentVolumeSource": {
        "description": "Represents a Ceph Filesystem mount that lasts the lifetime of a pod Cephfs volumes do not support ownership management or SELinux relabeling.",
        "properties": {
          "monitors": {
            "description": "monitors is Required: Monitors is a collection of Ceph monitors More info: https://examples.k8s.io/volumes/cephfs/README.md#how-to-use-it",
            "items": {
              "default": "",
              "type": "string"
            },
            "type": "array"
          },
          "path": {
            "description": "path is Optional: Used as the mounted root, rather than the full Ceph tree, default is /",
            "type": "string"
          },
          "readOnly": {
            "description": "readOnly is Optional: Defaults to false (read/write). ReadOnly here will force the ReadOnly setting in VolumeMounts. More info: https://examples.k8s.io/volumes/cephfs/README.md#how-to-use-it",
            "type": "boolean"
          },
          "secretFile": {
            "description": "secretFile is Optional: SecretFile is the path to key ring for User, default is /etc/ceph/user.secret More info: https://examples.k8s.io/volumes/cephfs/README.md#how-to-use-it",
            "type": "string"
          },
          "secretRef": {
            "allOf": [
              {
                "$ref": "#/components/schemas/io.k8s.api.core.v1.SecretReference"
              }
            ],
            "description": "secretRef is Optional: SecretRef is reference to the authentication secret for User, default is empty. More info: https://examples.k8s.io/volumes/cephfs/README.md#how-to-use-it"
          },
          "user": {
            "description": "user is Optional: User is the rados user name, default is admin More info: https://examples.k8s.io/volumes/cephfs/README.md#how-to-use-it",
            "type": "string"
          }
        },
        "required": [
          "monitors"
        ],
        "type": "object"
      },
      "io.k8s.api.core.v1.CinderPersistentVolumeSource": {
        "description": "Represents a cinder volume resource in Openstack. A Cinder volume must exist before mounting to a container. The volume must also be in the same region as the kubelet. Cinder volumes support ownership management and SELinux relabeling.",
        "properties": {
          "fsType": {
            "description": "fsType Filesystem type to mount. Must be a filesystem type supported by the host operating system. Examples: \"ext4\", \"xfs\", \"ntfs\". Implicitly inferred to be \"ext4\" if unspecified. More info: https://examples.k8s.io/mysql-cinder-pd/README.md",
            "type": "string"
          },
          "readOnly": {
            "description": "readOnly is Optional: Defaults to false (read/write). ReadOnly here will force the ReadOnly setting in VolumeMounts. More info: https://examples.k8s.io/mysql-cinder-pd/README.md",
            "type": "boolean"
          },
          "secretRef": {
            "allOf": [
              {
                "$ref": "#/components/schemas/io.k8s.api.core.v1.SecretReference"
              }
            ],
            "description": "secretRef is Optional: points to a secret object containing parameters used to connect to OpenStack."
          },
          "volumeID": {
            "default": "",
            "description": "volumeID used to identify the volume in cinder. More info: https://examples.k8s.io/mysql-cinder-pd/README.md",
            "type": "string"
          }
        },
        "required": [
          "volumeID"
        ],
        "type": "object"
      },
      "io.k8s.api.core.v1.FCVolumeSource": {
        "description": "Represents a Fibre Channel volume. Fibre Channel volumes can only be mounted as read/write once. Fibre Channel volumes support ownership management and SELinux relabeling.",
        "properties": {
          "fsType": {
            "description": "fsType is the filesystem type to mount. Must be a filesystem type supported by the host operating system. Ex. \"ext4\", \"xfs\", \"ntfs\". Implicitly inferred to be \"ext4\" if unspecified.",
            "type": "string"
          },
          "lun": {
            "description": "lun is Optional: FC target lun number",
            "format": "int32",
            "type": "integer"
          },
          "readOnly": {
            "description": "readOnly is Optional: Defaults to false (read/write). ReadOnly here will force the ReadOnly setting in VolumeMounts.",
            "type": "boolean"
          },
          "targetWWNs": {
            "description": "targetWWNs is Optional: FC target worldwide names (WWNs)",
            "items": {
              "default": "",
              "type": "string"
            },
            "type": "array"
          },
          "wwids": {
            "description": "wwids Optional: FC volume world wide identifiers (wwids) Either wwids or combination of targetWWNs and lun must be set, but not both simultaneously.",
            "items": {
              "default": "",
              "type": "string"
            },
            "type": "array"
          }
        },
        "type": "object"
      },
      "io.k8s.api.core.v1.FlexPersistentVolumeSource": {
        "description": "FlexPersistentVolumeSource represents a generic persistent volume resource that is provisioned/attached using an exec based plugin.",
        "properties": {
          "driver": {
            "default": "",
            "description": "driver is the name of the driver to use for this volume.",
            "type": "string"
          },
          "fsType": {
            "description": "fsType is the Filesystem type to mount. Must be a filesystem type supported by the host operating system. Ex. \"ext4\", \"xfs\", \"ntfs\". The default filesystem depends on FlexVolume script.",
            "type": "string"
          },
          "options": {
            "additionalProperties": {
              "default": "",
              "type": "string"
            },
            "description": "options is Optional: this field holds extra command options if any.",
            "type": "object"
          },
          "readOnly": {
            "description": "readOnly is Optional: defaults to false (read/write). ReadOnly here will force the ReadOnly setting in VolumeMounts.",
            "type": "boolean"
          },
          "secretRef": {
            "allOf": [
              {
                "$ref": "#/components/schemas/io.k8s.api.core.v1.SecretReference"
              }
            ],
            "description": "secretRef is Optional: SecretRef is reference to the secret object containing sensitive information to pass to the plugin scripts. This may be empty if no secret object is specified. If the secret object contains more than one secret, all secrets are passed to the plugin scripts."
          }
        },
        "required": [
          "driver"
        ],
        "type": "object"
      },
      "io.k8s.api.core.v1.FlockerVolumeSource": {
        "description": "Represents a Flocker volume mounted by the Flocker agent. One and only one of datasetName and datasetUUID should be set. Flocker volumes do not support ownership management or SELinux relabeling.",
        "properties": {
          "datasetName": {
            "description": "datasetName is Name of the dataset stored as metadata -> name on the dataset for Flocker should be considered as deprecated",
            "type": "string"
          },
          "datasetUUID": {
            "description": "datasetUUID is the UUID of the dataset. This is unique identifier of a Flocker dataset",
            "type": "string"
          }
        },
        "type": "object"
      },
      "io.k8s.api.core.v1.GCEPersistentDiskVolumeSource": {
        "description": "Represents a Persistent Disk resource in Google Compute Engine.\n\nA GCE PD must exist before mounting to a container. The disk must also be in the same GCE project and zone as the kubelet. A GCE PD can only be mounted as read/write once or read-only many times. GCE PDs support ownership management and SELinux relabeling.",
        "properties": {
          "fsType": {
            "description": "fsType is filesystem type of the volume that you want to mount. Tip: Ensure that the filesystem type is supported by the host operating system. Examples: \"ext4\", \"xfs\", \"ntfs\". Implicitly inferred to be \"ext4\" if unspecified. More info: https://kubernetes.io/docs/concepts/storage/volumes#gcepersistentdisk",
            "type": "string"
          },
          "partition": {
            "description": "partition is the partition in the volume that you want to mount. If omitted, the default is to mount by volume name. Examples: For volume /dev/sda1, you specify the partition as \"1\". Similarly, the volume partition for /dev/sda is \"0\" (or you can leave the property empty). More info: https://kubernetes.io/docs/concepts/storage/volumes#gcepersistentdisk",
            "format": "int32",
            "type": "integer"
          },
          "pdName": {
            "default": "",
            "description": "pdName is unique name of the PD resource in GCE. Used to identify the disk in GCE. More info: https://kubernetes.io/docs/concepts/storage/volumes#gcepersistentdisk",
            "type": "string"
          },
          "readOnly": {
            "description": "readOnly here will force the ReadOnly setting in VolumeMounts. Defaults to false. More info: https://kubernetes.io/docs/concepts/storage/volumes#gcepersistentdisk",
            "type": "boolean"
          }
        },
        "required": [
          "pdName"
        ],
        "type": "object"
      },
      "io.k8s.api.core.v1.GlusterfsPersistentVolumeSource": {
        "description": "Represents a Glusterfs mount that lasts the lifetime of a pod. Glusterfs volumes do not support ownership management or SELinux relabeling.",
        "properties": {
          "endpoints": {
            "default": "",
            "description": "endpoints is the endpoint name that details Glusterfs topology. More info: https://examples.k8s.io/volumes/glusterfs/README.md#create-a-pod",
            "type": "string"
          },
          "endpointsNamespace": {
            "description": "endpointsNamespace is the namespace that contains Glusterfs endpoint. If this field is empty, the EndpointNamespace defaults to the same namespace as the bound PVC. More info: https://examples.k8s.io/volumes/glusterfs/README.md#create-a-pod",
            "type": "string"
          },
          "path": {
            "default": "",
            "description": "path is the Glusterfs volume path. More info: https://examples.k8s.io/volumes/glusterfs/README.md#create-a-pod",
            "type": "string"
          },
          "readOnly": {
            "description": "readOnly here will force the Glusterfs volume to be mounted with read-only permissions. Defaults to false. More info: https://examples.k8s.io/volumes/glusterfs/README.md#create-a-pod",
            "type": "boolean"
          }
        },
        "required": [
          "endpoints",
          "path"
        ],
        "type": "object"
      },
      "io.k8s.api.core.v1.HostPathVolumeSource": {
        "description": "Represents a host path mapped into a pod. Host path volumes do not support ownership management or SELinux relabeling.",
        "properties": {
          "path": {
            "default": "",
            "description": "path of the directory on the host. If the path is a symlink, it will follow the link to the real path. More info: https://kubernetes.io/docs/concepts/storage/volumes#hostpath",
            "type": "string"
          },
          "type": {
            "description": "type for HostPath Volume Defaults to \"\" More info: https://kubernetes.io/docs/concepts/storage/volumes#hostpath",
            "type": "string"
          }
        },
        "required": [
          "path"
        ],
        "type": "object"
      },
      "io.k8s.api.core.v1.ISCSIPersistentVolumeSource": {
        "description": "ISCSIPersistentVolumeSource represents an ISCSI disk. ISCSI volumes can only be mounted as read/write once. ISCSI volumes support ownership management and SELinux relabeling.",
        "properties": {
          "chapAuthDiscovery": {
            "description": "chapAuthDiscovery defines whether support iSCSI Discovery CHAP authentication",
            "type": "boolean"
          },
          "chapAuthSession": {
            "description": "chapAuthSession defines whether support iSCSI Session CHAP authentication",
            "type": "boolean"
          },
          "fsType": {
            "description": "fsType is the filesystem type of the volume that you want to mount. Tip: Ensure that the filesystem type is supported by the host operating system. Examples: \"ext4\", \"xfs\", \"ntfs\". Implicitly inferred to be \"ext4\" if unspecified. More info: https://kubernetes.io/docs/concepts/storage/volumes#iscsi",
            "type": "string"
          },
          "initiatorName": {
            "description": "initiatorName is the custom iSCSI Initiator Name. If initiatorName is specified with iscsiInterface simultaneously, new iSCSI interface <target portal>:<volume name> will be created for the connection.",
            "type": "string"
          },
          "iqn": {
            "default": "",
            "description": "iqn is Target iSCSI Qualified Name.",
            "type": "string"
          },
          "iscsiInterface": {
            "description": "iscsiInterface is the interface Name that uses an iSCSI transport. Defaults to 'default' (tcp).",
            "type": "string"
          },
          "lun": {
            "default": 0,
            "description": "lun is iSCSI Target Lun number.",
            "format": "int32",
            "type": "integer"
          },
          "portals": {
            "description": "portals is the iSCSI Target Portal List. The Portal is either an IP or ip_addr:port if the port is other than default (typically TCP ports 860 and 3260).",
            "items": {
              "default": "",
              "type": "string"
            },
            "type": "array"
          },
          "readOnly": {
            "description": "readOnly here will force the ReadOnly setting in VolumeMounts. Defaults to false.",
            "type": "boolean"
          },
          "secretRef": {
            "allOf": [
              {
                "$ref": "#/components/schemas/io.k8s.api.core.v1.SecretReference"
              }
            ],
            "description": "secretRef is the CHAP Secret for iSCSI target and initiator authentication"
          },
          "targetPortal": {
            "default": "",
            "description": "targetPortal is iSCSI Target Portal. The Portal is either an IP or ip_addr:port if the port is other than default (typically TCP ports 860 and 3260).",
            "type": "string"
          }
        },
        "required": [
          "targetPortal",
          "iqn",
          "lun"
        ],
        "type": "object"
      },
      "io.k8s.api.core.v1.LocalVolumeSource": {
        "description": "Local represents directly-attached storage with node affinity (Beta feature)",
        "properties": {
          "fsType": {
            "description": "fsType is the filesystem type to mount. It applies only when the Path is a block device. Must be a filesystem type supported by the host operating system. Ex. \"ext4\", \"xfs\", \"ntfs\". The default value is to auto-select a filesystem if unspecified.",
            "type": "string"
          },
          "path": {
            "default": "",
            "description": "path of the full path to the volume on the node. It can be either a directory or block device (disk, partition, ...).",
            "type": "string"
          }
        },
        "required": [
          "path"
        ],
        "type": "object"
      },
      "io.k8s.api.core.v1.NFSVolumeSource": {
        "description": "Represents an NFS mount that lasts the lifetime of a pod. NFS volumes do not support ownership management or SELinux relabeling.",
        "properties": {
          "path": {
            "default": "",
            "description": "path that is exported by the NFS server. More info: https://kubernetes.io/docs/concepts/storage/volumes#nfs",
            "type": "string"
          },
          "readOnly": {
            "description": "readOnly here will force the NFS export to be mounted with read-only permissions. Defaults to false. More info: https://kubernetes.io/docs/concepts/storage/volumes#nfs",
            "type": "boolean"
          },
          "server": {
            "default": "",
            "description": "server is the hostname or IP address of the NFS server. More info: https://kubernetes.io/docs/concepts/storage/volumes#nfs",
            "type": "string"
          }
        },
        "required": [
          "server",
          "path"
        ],
        "type": "object"
      },
      "io.k8s.api.core.v1.NodeSelector": {
        "description": "A node selector represents the union of the results of one or more label queries over a set of nodes; that is, it represents the OR of the selectors represented by the node selector terms.",
        "properties": {
          "nodeSelectorTerms": {
            "description": "Required. A list of node selector terms. The terms are ORed.",
            "items": {
              "allOf": [
                {
                  "$ref": "#/components/schemas/io.k8s.api.core.v1.NodeSelectorTerm"
                }
              ],
              "default": {}
            },
            "type": "array"
          }
        },
        "required": [
          "nodeSelectorTerms"
        ],
        "type": "object",
        "x-kubernetes-map-type": "atomic"
      },
      "io.k8s.api.core.v1.NodeSelectorRequirement": {
        "description": "A node selector requirement is a selector that contains values, a key, and an operator that relates the key and values.",
        "properties": {
          "key": {
            "default": "",
            "description": "The label key that the selector applies to.",
            "type": "string"
          },
          "operator": {
            "default": "",
            "description": "Represents a key's relationship to a set of values. Valid operators are In, NotIn, Exists, DoesNotExist. Gt, and Lt.\n\n",
            "type": "string"
          },
          "values": {
            "description": "An array of string values. If the operator is In or NotIn, the values array must be non-empty. If the operator is Exists or DoesNotExist, the values array must be empty. If the operator is Gt or Lt, the values array must have a single element, which will be interpreted as an integer. This array is replaced during a strategic merge patch.",
            "items": {
              "default": "",
              "type": "string"
            },
            "type": "array"
          }
        },
        "required": [
          "key",
          "operator"
        ],
        "type": "object"
      },
      "io.k8s.api.core.v1.NodeSelectorTerm": {
        "description": "A null or empty node selector term matches no objects. The requirements of them are ANDed. The TopologySelectorTerm type implements a subset of the NodeSelectorTerm.",
        "properties": {
          "matchExpressions": {
            "description": "A list of node selector requirements by node's labels.",
            "items": {
              "allOf": [
                {
                  "$ref": "#/components/schemas/io.k8s.api.core.v1.NodeSelectorRequirement"
                }
              ],
              "default": {}
            },
            "type": "array"
          },
          "matchFields": {
            "description": "A list of node selector requirements by node's fields.",
            "items": {
              "allOf": [
                {
                  "$ref": "#/components/schemas/io.k8s.api.core.v1.NodeSelectorRequirement"
                }
              ],
              "default": {}
            },
            "type": "array"
          }
        },
        "type": "object",
        "x-kubernetes-map-type": "atomic"
      },
      "io.k8s.api.core.v1.ObjectReference": {
        "description": "ObjectReference contains enough information to let you inspect or modify the referred object.",
